-- ----------------------------
-- View structure for `bill_chiphi_full_view`
-- ----------------------------
DROP VIEW IF EXISTS `bill_chiphi_full_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `bill_chiphi_full_view` AS select `branch`.`tax_code_chinhanh` AS `tax_code_chinhanh`,`bill_chi_phi`.`id` AS `id1`,`bill_chi_phi`.`id` AS `id`,`bill_chi_phi`.`description` AS `description`,date_format(`bill_chi_phi`.`created_at`,'%Y.%m.%d') AS `created_at`,`bill_chi_phi`.`bill_sign_id` AS `bill_sign_id`,`bill_chi_phi`.`bill_number` AS `bill_number`,`bill_chi_phi`.`tax_sum` AS `tax_sum_number`,replace(format(`bill_chi_phi`.`tax_sum`,0),',','.') AS `tax_sum`,`bill_chi_phi`.`sum_and_sumtax` AS `sum_and_sumtax_number`,replace(format(`bill_chi_phi`.`sum_and_sumtax`,0),',','.') AS `sum_and_sumtax`,`bill_chi_phi`.`sum` AS `sum_number`,replace(format(`bill_chi_phi`.`sum`,0),',','.') AS `sum`,replace(format((`bill_chi_phi`.`sum_and_sumtax` + `bill_chi_phi`.`tax_sum`),0),',','.') AS `sum_and_sumtax_all`,replace(format((`bill_chi_phi`.`sum` + `bill_chi_phi`.`tax_sum`),0),',','.') AS `sum_all`,`branch`.`full_name` AS `full_name`,`branch`.`short_hand_name` AS `short_hand_name`,`branch`.`id` AS `branch_id`,`branch`.`tax_code` AS `tax_code`,`branch`.`address` AS `address`,`bill_chi_phi`.`payment_method_id` AS `payment_method_id`,`bill_chi_phi`.`is_monthly` AS `is_monthly`,`bill_chi_phi`.`is_complete` AS `is_complete`,`bill_chi_phi`.`is_paying` AS `is_paying` from (`bill_chi_phi` join `branch` on((`branch`.`id` = `bill_chi_phi`.`branch_id`)));

-- ----------------------------
-- View structure for `bill_detail_full_view`
-- ----------------------------
DROP VIEW IF EXISTS `bill_detail_full_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `bill_detail_full_view` AS select `bill_detail`.`thuchi_id` AS `thuchi_id`,`goods`.`unit_full_name` AS `unit_full_name`,`bill_detail`.`bill_id` AS `bill_id`,`goods`.`goods_full_name` AS `goods_full_name`,`goods`.`id` AS `goods_id`,replace(format(`bill_detail`.`quantity`,0),',','.') AS `quantity`,replace(format(`bill_detail`.`price`,0),',','.') AS `price`,replace(format(`bill_detail`.`price_has_tax`,0),',','.') AS `price_has_tax`,replace(format((`bill_detail`.`price` * `bill_detail`.`quantity`),0),',','.') AS `sum`,replace(format((((`bill_detail`.`price` * `bill_detail`.`quantity`) * `goods`.`tax`) / 100),0),',','.') AS `sum_tax`,`goods`.`tax` AS `tax` from (`bill_detail` join `goods` on((`goods`.`id` = `bill_detail`.`goods_id`)));

-- ----------------------------
-- View structure for `bill_full_view`
-- ----------------------------
DROP VIEW IF EXISTS `bill_full_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `bill_full_view` AS select `branch`.`tax_code_chinhanh` AS `tax_code_chinhanh`,`bill`.`id` AS `id1`,`bill`.`id` AS `id`,`bill`.`is_printed` AS `is_printed`,date_format(`bill`.`created_at`,'%Y.%m.%d') AS `created_at`,`bill`.`bill_sign_id` AS `bill_sign_id`,`bill`.`bill_number` AS `bill_number`,`bill`.`tax_sum` AS `tax_sum_number`,replace(format(`bill`.`tax_sum`,0),',','.') AS `tax_sum`,`bill`.`sum_and_sumtax` AS `sum_and_sumtax_number`,replace(format(`bill`.`sum_and_sumtax`,0),',','.') AS `sum_and_sumtax`,`bill`.`sum` AS `sum_number`,replace(format(`bill`.`sum`,0),',','.') AS `sum`,replace(format((`bill`.`sum_and_sumtax` + `bill`.`tax_sum`),0),',','.') AS `sum_and_sumtax_all`,replace(format((`bill`.`sum` + `bill`.`tax_sum`),0),',','.') AS `sum_all`,`branch`.`full_name` AS `full_name`,`branch`.`short_hand_name` AS `short_hand_name`,`branch`.`id` AS `branch_id`,`branch`.`tax_code` AS `tax_code`,`branch`.`address` AS `address`,(select count(0) AS `count_lien1` from `bill_history` where ((`bill_history`.`bill_id` = `id1`) and (`bill_history`.`is_preview` = 0) and (`bill_history`.`printed_at` is not null) and (`bill_history`.`print_type` = 1))) AS `count_lien1`,(select count(0) AS `count_lien2` from `bill_history` where ((`bill_history`.`bill_id` = `id1`) and (`bill_history`.`is_preview` = 0) and (`bill_history`.`printed_at` is not null) and (`bill_history`.`print_type` = 2))) AS `count_lien2`,`bill`.`payment_method_id` AS `payment_method_id`,`bill`.`is_complete` AS `is_complete`,`bill`.`is_paying` AS `is_paying` from (`bill` join `branch` on((`branch`.`id` = `bill`.`branch_id`)));

-- ----------------------------
-- View structure for `bill_input_detail_full_view`
-- ----------------------------
DROP VIEW IF EXISTS `bill_input_detail_full_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `bill_input_detail_full_view` AS select `goods`.`unit_full_name` AS `unit_full_name`,`bill_input_detail`.`bill_id` AS `bill_id`,`goods`.`goods_full_name` AS `goods_full_name`,`goods`.`id` AS `goods_id`,replace(format(`bill_input_detail`.`quantity`,0),',','.') AS `quantity`,replace(format(`bill_input_detail`.`price`,0),',','.') AS `price`,replace(format(`bill_input_detail`.`price_has_tax`,0),',','.') AS `price_has_tax`,replace(format((`bill_input_detail`.`price` * `bill_input_detail`.`quantity`),0),',','.') AS `sum`,replace(format((((`bill_input_detail`.`price` * `bill_input_detail`.`quantity`) * `goods`.`tax`) / 100),0),',','.') AS `sum_tax`,`goods`.`tax` AS `tax` from (`bill_input_detail` join `goods` on((`goods`.`id` = `bill_input_detail`.`goods_id`))) where (`bill_input_detail`.`is_international` = 0);

