-- ----------------------------
-- Function structure for `get_tong_tien`
-- ----------------------------
DROP FUNCTION IF EXISTS `get_tong_tien`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `get_tong_tien`(goodsunit_id INT) RETURNS int(11)
BEGIN
 
  DECLARE quantity_sum int;
DECLARE tong_tien int;
declare currKeywordID int;
set tong_tien=0;
    SELECT sum(quantity) INTO quantity_sum FROM bill_detail WHERE goods_id = goodsunit_id;

drop temporary table if exists keywords_temp;
create temporary table keywords_temp as
select bill_input_detail.id,quantity, price_has_tax from bill_input_detail join bill_input on bill_input.id=bill_input_detail.bill_id where goods_id=goodsunit_id;

while (select count(*) from keywords_temp) > 0
